local core=require("wetgenes.aelua.cache.core")local os=osmodule("wetgenes.aelua.cache")function countzero()	count=0	count_got=0	api_time=0endcountzero()local start_time -- handle simple api benchmarking of some callslocal function apis()	start_time=os.time()endlocal function apie(...)	api_time=api_time+os.time()-start_time	return ...endfunction del(...)	apis()	return apie(core.del(...))endfunction put(...)	apis()	return apie(core.put(...))endfunction get(...)	apis()	count=count+1	local r=apie(core.get(...))		if r then count_got=count_got+1 end	return rendfunction inc(...)	apis()	local r=apie(core.inc(...))	return rend